    "okefenokee-national-wildlife-refuge-narrative-report-september-december-1948-f36b4",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Okefenokee NWR
    outlines Refuge accomplishments from September through December of 1948. The report
    begins by summarizing the weather conditions and water conditions during this period.
    Wildlife- including migratory birds, upland game birds, big game animals, furbearers,
    predators, raptors, fish, and reptiles- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include timber removal. The public relations section of the report
    describes recreational uses, Refuge visitors, Refuge participation, hunting, fishing,
    and violations. Items of interest and N-R forms are attached.",nt"license_title":
